import React from 'react';

const Header = () => {
  return (
    <header className="bg-black text-white p-4">
      <nav className="container mx-auto flex justify-between items-center">
        <div className="flex items-center">
          <img src={logo} alt="Logo" className="h-10 w-10 mr-4" />
          <span className="text-lg font-semibold">Desktop (THE GOOD ONE)</span>
        </div>
        <div className="hidden md:flex space-x-6">
          <Link to="/" className="hover:text-gray-400">About</Link>
          <Link to="/applications" className="hover:text-gray-400">Applications</Link>
          <Link to="/sponsors" className="hover:text-gray-400">Sponsors</Link>
          <Link to="/faq" className="hover:text-gray-400">FAQ</Link>
          <Link to="/team" className="hover:text-gray-400">The Team</Link>
          <Link to="/contact" className="hover:text-gray-400">Contact Us</Link>
        </div>
      </nav>
    </header>
  );
};

export default Header;
